import Zoom from 'react-reveal/Zoom';
import './Leafs.css'
import React from 'react';

const Leafs_and_clouds = () => {
    return ( 
        <>
        <Zoom>
            <img className='leaf1' src="./leafnobg.png" alt="" />
        </Zoom>
        </>
     );
}
 
export default Leafs_and_clouds;
